from tensorflow.keras.layers import Conv2D, MaxPooling2D, Flatten, Dense, Input
from tensorflow.keras.models import Model

def yolo_model(input_shape):
    inputs = Input(shape=input_shape)

    # Bloque 1
    x = Conv2D(64, (7, 7), strides=2, padding='same', activation='relu')(inputs)
    x = MaxPooling2D((2, 2), strides=2, padding='same')(x)

    # Bloque 2
    x = Conv2D(192, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = MaxPooling2D((2, 2), strides=2, padding='same')(x)

    # Bloque 3
    x = Conv2D(128, (1, 1), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(256, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(256, (1, 1), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(512, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = MaxPooling2D((2, 2), strides=2, padding='same')(x)

    # Bloque 4
    for _ in range(4):
        x = Conv2D(256, (1, 1), strides=1, padding='same', activation='relu')(x)
        x = Conv2D(512, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(512, (1, 1), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(1024, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = MaxPooling2D((2, 2), strides=2, padding='same')(x)

    # Bloque 5
    for _ in range(2):
        x = Conv2D(512, (1, 1), strides=1, padding='same', activation='relu')(x)
        x = Conv2D(1024, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(1024, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(1024, (3, 3), strides=2, padding='same', activation='relu')(x)

    # Bloque 6
    x = Conv2D(1024, (3, 3), strides=1, padding='same', activation='relu')(x)
    x = Conv2D(1024, (3, 3), strides=1, padding='same', activation='relu')(x)

    # Capa totalmente conectada
    x = Flatten()(x)
    x = Dense(4096, activation='relu')(x)
    x = Dense(7 * 7 * 30, activation='linear')(x)

    model = Model(inputs, x)
    return model

input_shape = (448, 448, 3)
model = yolo_model(input_shape)
model.summary()

