"""## Definición de la Función de Pérdida"""

def yolo_loss(y_true, y_pred):
    # Implementación básica de la función de pérdida de YOLO
    # Debe considerar la pérdida de las coordenadas, la confianza y la clasificación
    return tf.reduce_sum(tf.square(y_true - y_pred))  # Simplificación extrema

